import "./App.css";
import { Container } from "react-bootstrap";
import {BrowserRouter,Route,Switch} from 'react-router-dom';
import TopBar from "./components/TopBar";


function App() {
  return (
    <>
      <BrowserRouter>
      <TopBar/>
      <Switch>
        <Route path="/about" components={About} exact/>
      </Switch>
      </BrowserRouter>
    </>
  );
}

export default App;
